    const [markets, setMarkets] = useState(null)

    useEffect(() => {
        Mercado(setMarkets)
    },[])

    return(
        <div>

            <header className="App-header">
                <h1>
                    Mercados
                </h1>

            </header>
        </div>
    )
}
export default Mercados
